import React from 'react'

class Form extends React.Component {
  render() {
    return (
      <div>
        <form>
          <h1>Adicionar Nova Carta</h1>
          <label htmlFor="name">Nome</label>
          <input type="text" name="name" data-testid="name-input" name="name" ></input>

          <label htmlFor="description-input">Nome</label>
          <textarea type="text" name="description-input" data-testid="description-input"
          id="description-input"></textarea>
        </form>
      </div>
    )
  }
}

export default Form
